@font-face {
  font-family: 'Sans';
  src: url('ComicShannsMonoNerdFontMono-Regular.otf') format('opentype'),
    url('ComicShannsMonoNerdFontMono-Regular.woff') format('woff'),
    url('ComicShannsMonoNerdFontMono-Regular.woff2') format('woff2');
}


/* scrollbar.css */
html {
  scrollbar-width: thin;
  /* Firefox */
  scrollbar-color: rgba(233, 30, 99, 0.6) rgba(255, 255, 255, 0.1);
  /* Firefox */
}

body::-webkit-scrollbar {
  width: 8px;
  height: 8px;
}

body::-webkit-scrollbar-track {
  background: rgba(255, 255, 255, 0.1);
  /* Almost transparent background */
  border-radius: 10px;
}

body::-webkit-scrollbar-thumb {
  background-color: rgba(233, 30, 99, 0.6);
  /* Semi-transparent pink */
  border-radius: 10px;
  border: 2px solid rgba(255, 255, 255, 0.3);
  /* Slightly transparent border */
  transition: background-color 0.3s ease, border 0.3s ease;
}

body::-webkit-scrollbar-thumb:hover {
  background-color: rgba(233, 30, 99, 0.8);
  /* Darker pink on hover */
  border: 2px solid rgba(255, 255, 255, 0.5);
  /* Less transparent border on hover */
}

body::-webkit-scrollbar-thumb:active {
  background-color: rgba(233, 30, 99, 1);
  /* Solid pink on active */
  border: 2px solid rgba(255, 255, 255, 0.7);
  /* Almost opaque border on active */
}

